import { RouterOutlet } from '@angular/router';
import { Navbar } from './Navbar/navbar/navbar';
import { Hero } from './comment/hero/hero';

@Component({
  selector: 'app-root',
  imports: [RouterOutlet, Navbar, Hero],
  template: `
    <navbar/>
    <hero/>
    <router-outlet/>
  `,
  standalone: true
})
export class App { }
